	// with 100,000 precomputed, there are 9592
	// TODO: precompute this also
	public static int nthPrime(int n) {
		return nthPrimeFrom(n, 0);
	}
	
	public static int nthPrimeFrom(int n, int from) {
		int count = 0;
		for (int i = from; i < primality.length; i++) {
			if (primality[i] == 1) {
				if (count == n) {
					return i;
				}
				count++;
			}
		}
		throw new IllegalArgumentException("not enough primes precomputed, we only have " + count + " primes from " + from + " to " + (primality.length - 1));
	}

	public static boolean isPrime(int i) {
		if (i > primality.length) {
			throw new IllegalArgumentException("Asking about the primality of " + i + " but the max we have precomputed is " + primality.length);
		}
		return primality[i] == 1;
	}
